import { Link } from "react-router-dom";
// import logo from '../assets/Logo1.png';
import "./Navbar.css";

export default function Navbar({logo, links}) {
  return (
    <nav className="navbar navbar-expand-lg navbar-light bg-light">
      <div className="container">
        <Link className="navbar-brand" to="/">
          {/* <img src={logo} alt="werty logo" style={{width: '100px', height: '50px', marginRight:'20px'}} /> */}
          <h1 className="title">{logo}</h1>
        </Link>
        <ul
          className="navbar-nav ml-auto"
          style={{ display: "flex", alignItems: "center" }}
        >
            {links.map((link, index)=>(
                    <li className="nav-item">
                    <Link className="nav-link" activeClassName="active" to={link.to}>
                      {link.label}
                    </Link>
                  </li>
            ))}
          
          <li className="navbar-nav ml-auto">
            <Link className="nav-link" activeClassName="active" to="/login">
              Login
            </Link>
          </li>
        </ul>
      </div>
    </nav>
  );
}
